import { Grid,Box ,Button, Input,MenuItem,FormControl,InputLabel,Select,FormHelperText, Stack} from "@mui/material";
import { Icon } from '@iconify/react';
import { useState } from "react";


const initialValues={
    inputLang:"",
    outputLang:"",
    audioFile:""

  };

function UploadFile()
{
    const [inputLang, setinputLang] = useState('');

    const [outputLang, setoutputLang] = useState('');

    const [data , setdata] = useState(initialValues);
    // const handleChange = (e) => {
    //     setdata({...user,[e.target.name]:e.target.value})
    // };
    const age=20

    const handleChange=(e)=>{
        setdata({...data,[e.target.name]:e.target.value})
        console.log(data);
        console.log(e.target.va)
    }

    const handleSubmit=(e)=>{
        console.log(data)
    }

    return(
        <>

            <Grid container direction="row" justifyContent="center" alignment="center" my={25} mr={50}>
                <Stack>
                    <div>
                        <FormControl required sx={{ m: 1, minWidth: 300 }}>
                                <InputLabel id="demo-simple-select-required-label">Input Language</InputLabel>
                                <Select
                                labelId="demo-simple-select-required-label"
                                id="demo-simple-select-required"
                                value={age}
                                name="inputLang"
                                label="Input Language *"
                                onChange={(e)=>handleChange(e)}
                                required
                                >
                                <MenuItem value="">
                                    <em>None</em>
                                </MenuItem>
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Twenty</MenuItem>
                                <MenuItem value={30}>Thirty</MenuItem>
                                </Select>
                                <FormHelperText>Required</FormHelperText>
                        </FormControl>

                    </div>

                    <div>
                        <FormControl required sx={{ m: 1, minWidth: 300 }}>
                                <InputLabel id="demo-simple-select-required-label">Output Language</InputLabel>
                                <Select
                                labelId="demo-simple-select-required-label"
                                id="demo-simple-select-required"
                                value={age}
                                name="outputLang"
                                label="Output Language"
                                onChange={(e)=>handleChange(e)}
                                required 
                                >
                                <MenuItem value="">
                                    <em>None</em>
                                </MenuItem>
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Twenty</MenuItem>
                                <MenuItem value={30}>Thirty</MenuItem>
                                </Select>
                                <FormHelperText>Required</FormHelperText>
                        </FormControl>

                    </div>
                </Stack>

                <Box
                    sx={{
                    boxShadow: 3,
                    width: '700px',
                    height: '20',
                    bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
                    color: (theme) =>
                        theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800',
                    p: 1,
                    m: 1,
                    borderRadius: 5,
                    textAlign: 'center',
                    fontSize: '0.875rem',
                    fontWeight: '700',
                    alignment:'center'
                    }}
                    alignment="center"
                    justifyContent="center"
                    >

                    <Input
                        style={{
                        display: "none"
                        }}
                        accept=".json"  // specify the file type that you wanted to accept
                        id="choose-file"
                        type="file"
                        name="audioFile"
                        onChange={(e)=>{onchange(e)}}
                    />
                        <label htmlFor="choose-file">
                            <Icon icon="bi:upload" color="blue" width="200" height="200" />
                        </label>



                        <Box>
                        <Button variant="outlined" color='success' onSubmit={(e)=>handleSubmit(e)}>Submit</Button>
                        </Box>
                </Box>
            </Grid>

        </>
    );



}


export default UploadFile;
